        <p>Followers</p>
      </div>
      <div className="stat-info">
        <p>{props.likes}</p>
        <p>Likes</p>
      </div>
      <div className="stat-info">
        <p>{props.photos}</p>
        <p>Photos</p>
      </div>
    </div>
  );
};

export default Stats;
